s = ""
t = "TGTCTGGTG"

def subs(s,t):
    l = []
    for i in range (0, len(s) - len(t)):
        a = s[i:i+len(t)]
        if (a == t):
            l.append(i+1)
            
    return l

        

            
print(*subs(s,t))           
            